function modalityTest = testBimodality(data, ~)
    % testBimodality: Determines if a numeric dataset is unimodal or bimodal
    % using Hartigan's Dip Test. Compatible with the downloaded
    % hartigansdipsigniftest.m function.

    % Initialize output structure
    modalityTest = struct();

    % Remove NaN and Inf values
    data = data(~isnan(data) & isfinite(data));

    % Check for sufficient data
    if length(data) < 10
        modalityTest.modalityType = 'Insufficient_Data';
        modalityTest.pValue = 1;
        modalityTest.dipStatistic = NaN;
        return;
    end

    % Ensure Davis_Lab folder (with hartigansdipsigniftest.m) is on path
    davisLabPath = '/Users/cobybowman/Documents/MATLAB/Examples/R2022b/matlab/Davis_Lab';
    if ~contains(path, davisLabPath)
        addpath(davisLabPath);
        savepath; % optional: make it permanent
    end

    % Verify function exists
    if exist('hartigansdipsigniftest', 'file') ~= 2
        warning('hartigansdipsigniftest.m not found on path. Assuming unimodal.');
        modalityTest.modalityType = 'Unimodal';
        modalityTest.pValue = 1;
        modalityTest.dipStatistic = NaN;
        return;
    end

    % Try running the dip test
    try
        % Adjust this call based on your hartigansdipsigniftest signature:
        % most versions accept 1 input, some allow a second for nBoot iterations
        [dip, pValue] = hartigansdipsigniftest(data); 

        % Store results
        modalityTest.pValue = pValue;
        modalityTest.dipStatistic = dip;

        % Assign modality type
        if pValue < 0.05
            modalityTest.modalityType = 'Bimodal';
        else
            modalityTest.modalityType = 'Unimodal';
        end

    catch ME
        % If the function fails, assume unimodal
        warning('Hartigan''s Dip Test failed: %s. Assuming unimodal.', ME.message);
        modalityTest.modalityType = 'Unimodal';
        modalityTest.pValue = 1;
        modalityTest.dipStatistic = NaN;
    end
end

